;; **
;;; Set up variables. Change downtime means the duration when nobody moves after a change in light. Waiting cost function means that waiting 10 turns sucks more than 10x more than waiting 1 turn.
;; **

;; @@
(def simulation_duration 100)
(def traffic_a 0)
(def traffic_b 0.8)

(def change_downtime 2)

(defn waiting_cost [t] (+ (* 10 t) (* 1 t t) ) )

;; @@
;; =>
;;; {"type":"list-like","open":"","close":"","separator":"</pre><pre>","items":[{"type":"list-like","open":"","close":"","separator":"</pre><pre>","items":[{"type":"list-like","open":"","close":"","separator":"</pre><pre>","items":[{"type":"list-like","open":"","close":"","separator":"</pre><pre>","items":[{"type":"html","content":"<span class='clj-var'>#&#x27;template/simulation_duration</span>","value":"#'template/simulation_duration"},{"type":"html","content":"<span class='clj-var'>#&#x27;template/traffic_a</span>","value":"#'template/traffic_a"}],"value":"[#'template/simulation_duration,#'template/traffic_a]"},{"type":"html","content":"<span class='clj-var'>#&#x27;template/traffic_b</span>","value":"#'template/traffic_b"}],"value":"[[#'template/simulation_duration,#'template/traffic_a],#'template/traffic_b]"},{"type":"html","content":"<span class='clj-var'>#&#x27;template/change_downtime</span>","value":"#'template/change_downtime"}],"value":"[[[#'template/simulation_duration,#'template/traffic_a],#'template/traffic_b],#'template/change_downtime]"},{"type":"html","content":"<span class='clj-var'>#&#x27;template/waiting_cost</span>","value":"#'template/waiting_cost"}],"value":"[[[[#'template/simulation_duration,#'template/traffic_a],#'template/traffic_b],#'template/change_downtime],#'template/waiting_cost]"}
;; <=

;; **
;;; Set up a simple traffic system
;; **

;; **
;;; 
;; **

;; @@
(defquery traffic [duration]
  (let [
         traffic_cycle_a (sample (uniform-discrete 1 10))
         traffic_cycle_b (sample (uniform-discrete 1 10))
         ]
    (loop [
            turns_left duration
            queue_a (list)
            queue_b (list)
            a_left traffic_cycle_a
            b_left 0
            pass 0
            cost_times (list)
            iteration_log (list)
           ]
      (if (< turns_left 1)
        (let [total_cost_times (concat cost_times queue_a queue_b)]
          {:cycle_a traffic_cycle_a 
           :cycle_b traffic_cycle_b 
           :cost_times total_cost_times
           :iteration_log iteration_log}
          )
        
        (let [
               
               
               turn_situation {
                                :turns_left turns_left
                                :cost_times cost_times
                                :a_left a_left
                                :b_left b_left
                                :pass pass
                                :queue_a queue_a
                                :queue_b queue_b
                                }
               new_iteration_log (conj iteration_log turn_situation)
             
               
               new_a (sample (flip traffic_a))
               added_queue_a (if new_a (conj queue_a turns_left) queue_a)
               
               new_b (sample (flip traffic_b))
               added_queue_b (if new_b (conj queue_b turns_left) queue_b)
               
               new_queue_a (if
                             (and (> a_left 0) (= pass 0))
                             (drop-last added_queue_a)
                             added_queue_a
                             )

               new_queue_b (if
                             (and (> b_left) (= pass 0))
                             (drop-last added_queue_b)
                             added_queue_b
                             )
               
               new_a_left (if 
                            (> pass 0)
                            a_left
                            (if
                              (or (> b_left 1) (> a_left 0))
                              (max (- a_left 1) 0)
                              traffic_cycle_a
                              )
                            )
               
               new_b_left (if
                            (> pass 0)
                            b_left
                            (if
                              (or (> a_left 1) (> b_left 0))
                              (max (- b_left 1) 0)
                              traffic_cycle_b
                              )
                            )
               
               new_pass (if
                          (or (> new_a_left a_left) (> new_b_left b_left))
                          change_downtime
                          (max (- pass 1) 0)
                          )
               
               car_from_queue (if (> pass 0)
                               nil
                               (if (> b_left 0)
                                 (last queue_b)
                                 (last queue_a)
                                 
                                 )
                                )
               
               new_cost_times (if car_from_queue
                                (conj cost_times (- car_from_queue turns_left) )
                                cost_times
                                )
               
               
               ]
          (recur (- turns_left 1)
                 new_queue_a
                 new_queue_b
                 new_a_left
                 new_b_left
                 new_pass
                 new_cost_times
                 new_iteration_log
                 )
          )
          
        )
      )  ))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;template/traffic</span>","value":"#'template/traffic"}
;; <=

;; @@

(def query_def (doquery :lmh traffic [simulation_duration]))
(def query_sample (take 2000 (drop 1000 query_def)))
;; @@
;; =>
;;; {"type":"list-like","open":"","close":"","separator":"</pre><pre>","items":[{"type":"html","content":"<span class='clj-var'>#&#x27;template/query_def</span>","value":"#'template/query_def"},{"type":"html","content":"<span class='clj-var'>#&#x27;template/query_sample</span>","value":"#'template/query_sample"}],"value":"[#'template/query_def,#'template/query_sample]"}
;; <=

;; @@

(def results (map :result query_sample) )

(def performance (map (fn [x] {
               :cost (reduce + 0 (map waiting_cost (:cost_times x) ))
               :cycle_a (:cycle_a x)
               :cycle_b (:cycle_b x)
               } ) 
     results )
)

(sort-by :cost performance)









